import React from 'react';

export default function Item(props) {
  return props.order.map(e => (
    <>
      <div className="order-items-1">{e.qnt}</div>
      <div className="order-items-2">{e.item}</div>
      <div className="order-items-3">{e.price}</div>
    </>
  ));
}
